import React from 'react';
import { Courses, Footer, Header, Benefits } from './containers';
import { Brand, CTA, Navbar } from './components';
import './App.css';

const App = () => {
  return (
    <div className='App'>
      <div className='gradient_bg'>
        <Navbar/>
        <Header/>
        <Brand/>
      </div>
      <Courses/>
      <Benefits/>
      <CTA/>
      <Footer/>
    </div>
  )
}

export default App
